import React from 'react'

const Genre = () => {
  return (
    <div>
        <h1>SELECT YOUR GENRE</h1>
      <button style={{marginRight:10}}><Link to="/hiphop">HIP-HOP</Link></button>
      <button style={{marginRight:40}}><Link to="/pop">POP</Link></button>
      <button style={{marginRight:40}}><Link to="/classic">CLASSIC</Link></button>
    </div>
  )
}

export default Genre
